import React from 'react';
import { useHistory } from 'react-router-dom';
import './SelectionPage.css';

const SelectionPage = () => {
  const history = useHistory();

  const handleTesbihClick = () => {
    history.push('/newpage'); // Navigate to NewPage.js
  };

  const handleNormalClick = () => {
    history.push('/dhikr'); // Navigate to Dhikr.js
  };

  return (
    <div className="selection-container">
      <h1>Select Mode</h1>
      <button className="selection-button" onClick={handleTesbihClick}>
        Tesbih
      </button>
      <button className="selection-button" onClick={handleNormalClick}>
        Normal
      </button>
    </div>
  );
};

export default SelectionPage;
